commits.content:
@media screen and (max-width: 767px) {
.hero-section {
  background-color: var(--color-primary);
  text-align: center;
  padding-top: 72px;
  padding-bottom: 72px;
  background: var(--color-primary);
  background-image: linear-gradient(
      rgba(46, 47, 66, 0.7),
      rgba(46, 47, 66, 0.7)
    ),
    url(../../images/hero-office-mob.jpg);
  background-size: cover 320px 432px;
  background-repeat: no-repeat;
  background-position: center;

}
.hero-title {
  display: flex;
  font-size: 36px;
  font-weight: 700;
  line-height: 1.1;
  letter-spacing: 0.02em;
  color: var(--color-hero);
  padding-bottom: 72px;
  text-align: center;
  max-width: 190px;
  margin-right: auto;
  margin-left: auto;
}
.hero-button {
  font-family: 'Roboto', sans-serif;
  font-size: 16px;
  font-weight: 500;
  line-height: 1.5;
  letter-spacing: 0.04em;
  text-align: center;
  cursor: pointer;
  border: none;
  color: var(--color-hero);
  background-color: var(--color-brand);
  padding: 16px 32px;
  margin: 0;
  gap: 10px;
  border-radius: 4px;
  min-width: 169px;
  height: 56px;
  transition: background-color 250ms cubic-bezier(0.4, 0, 0.2, 1);
}
.hero-button:hover,
.hero-button:focus {
  background-color: var(--color-active);
}
}
@media screen and (min-width: 768px) and (max-width: 1167px) {
  .hero-section {
    background-color: var(--color-primary);
    text-align: center;
    padding-top: 112px;
    padding-bottom: 112px;
    background: var(--color-primary);
    background-image: linear-gradient(
        rgba(46, 47, 66, 0.7),
        rgba(46, 47, 66, 0.7)
      ),
      url(../../images/hero-office.jpg);
    background-size: cover 768px 436px;
    background-repeat: no-repeat;
    background-position: center;
  }

  .hero-title {
    font-size: 56px;
    font-weight: 700;
    line-height: 1.07;
    letter-spacing: 0.02em;
    color: var(--color-hero);

    text-align: center;
    margin: 0 auto 48px;
    max-width: 496px;
  }
  .hero-button {
    font-family: 'Roboto', sans-serif;
    font-size: 16px;
    font-weight: 500;
    line-height: 1.5;
    letter-spacing: 0.04em;
    text-align: center;
    cursor: pointer;
    border: none;
    color: var(--color-hero);
    background-color: var(--color-brand);
    padding: 16px 32px;
    margin: 0 auto;
    align-items: flex-start;
    gap: 10px;
    border-radius: 4px;
    display: block;
    min-width: 169px;
    height: 56px;
    transition: background-color 250ms cubic-bezier(0.4, 0, 0.2, 1);
  }
  .hero-button:hover,
  .hero-button:focus {
    background-color: var(--color-active);
  }
}
@media screen and (min-width: 1168px) {
.hero-section {
    background-color: var(--color-primary);
    text-align: center;
    padding-top: 188px;
    padding-bottom: 188px;
    background: var(--color-primary);
    background-image: linear-gradient(
        rgba(46, 47, 66, 0.7),
        rgba(46, 47, 66, 0.7)
      ),
      url(../../images/hero-office.jpg);
    background-size: cover;
    background-repeat: no-repeat;
    background-position: center;
  }

  .hero-title {
    font-size: 56px;
    font-weight: 700;
    line-height: 1.07;
    letter-spacing: 0.02em;
    color: var(--color-hero);
    padding-bottom: 0px;
    text-align: center;
    margin: 0 auto 48px;
    max-width: 496px;
  }
  .hero-button {
    font-family: 'Roboto', sans-serif;
    font-size: 16px;
    font-weight: 500;
    line-height: 1.5;
    letter-spacing: 0.04em;
    text-align: center;
    cursor: pointer;
    border: none;
    color: var(--color-hero);
    background-color: var(--color-brand);
    padding: 16px 32px;
    margin: 0 auto;
    align-items: flex-start;
    gap: 10px;
    border-radius: 4px;
    display: block;
    min-width: 169px;
    height: 56px;
    transition: background-color 250ms cubic-bezier(0.4, 0, 0.2, 1);
  }
  .hero-button:hover,
  .hero-button:focus {
    background-color: var(--color-active);
  }
}
